import React from "react";
import "./Register.css";

const Register = () => {
    return (
        <div className="register-container">
            <h1 className="register-title">Registro</h1>
            <form className="register-form">
                <div className="register-section">
                    <h2 className="register-subtitle">Información personal</h2>
                    <input type="text" placeholder="Nombre Completo" />
                    <input type="text" placeholder="Celular" />
                    <input type="email" placeholder="Correo" />
                    <input type="text" placeholder="Documento de identidad" />
                    <input type="password" placeholder="Contraseña" />
                </div>
                <div className="register-section">
                    <h2 className="register-subtitle">Información ministerial</h2>
                    <input type="text" placeholder="Congregación actual" />
                    <input type="text" placeholder="Distrito al que pertenece" />
                    <input type="number" placeholder="Años de ministerio" />
                </div>
                <div className="register-actions">
                    <button type="submit" className="register-button">Registrarse</button>
                    <a href="#" className="register-link">iniciar sesión</a>
                </div>
            </form>
        </div>
    );
};

export default Register;
